import React from 'react';
import './App.css';
import DataLoader from './components/DataLoader';
// import Slider from './components/Slider';
import Cards from './components/Cards';
import { getCards } from './api';

function App(props) {
  return (
    <DataLoader
      loadData={getCards}
      layout={(cards) => {
        <Slider>
          <Cards cardList={cards} />
        </Slider>;
      }}
    ></DataLoader>
  );
}

export default App;
